window.bookSummaryJSON = "<p><b>Come one, come all, to Harrow Faire...and greet your sweetest nightmare.</b></p> <p>Cora Glassâ€™ humdrum existence as a bank teller flips upside down when a long-abandoned circus mysteriously returns to life. But the entry fee to this big-top show is far more than Cora bargained for.</p> <p>A deal struck. A soul...stuck.</p> <p>As Harrow Faire shines a spotlight on Cora, she discovers there are far more secrets in that three-ring nightmare than she could possibly imagine. Trapped in the world of the fiendish and alluring man known as the Puppeteer, Cora finds herself caught in a war between him and the reclusive Mr. Harrow. Both parties will stop at nothing - even murder - to get what they want.</p> <p>And what they want...is her.</p>"; 
